import React from "react";
import './Home.css';

const Home = () => {
  return (
    <div class="h-100 w-100" className="home">
        <img
                    src={logo}
                    alt="Logo"
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                />
    </div>
  );
};

export default Home;
